import { Container, Nav, Tab, Row, Col } from "react-bootstrap";
import { ProjectCard } from "./ProjectCard";
import colorSharp2 from "../assets/img/color-sharp2.png";
import projImg1 from "../assets/img/project-img1.png";
import projImg2 from "../assets/img/project-img2.png";
import projImg3 from "../assets/img/project-img3.png";
import 'animate.css';
import TrackVisibility from 'react-on-screen';


export const Projects = () => {
    const project1 = [
        {
            title: "Portfolio Website",
            description: "HTML/CSS & React.js",
            imgUrl: projImg1,
        },
        {
            title: "Portfolio Website",
            description: "HTML/CSS & React.js",
            imgUrl: projImg1,
        },
        {
            title: "Portfolio Website",
            description: "HTML/CSS & React.js",
            imgUrl: projImg1,
        },
       
    ];
    const project2 = [
        {
            title: "Facial recognition",
            description: "Python & OpenCV",
            imgUrl: projImg2,
        },
        {
            title: "Facial recognition",
            description: "Python & OpenCV",
            imgUrl: projImg2,
        },
        {
            title: "Facial recognition",
            description: "Python & OpenCV",
            imgUrl: projImg2,
        },
       
    ];
    const project3 = [
        {
            title: "Balance Sheet",
            description: "Flutter",
            imgUrl: projImg3,
        },
        {
            title: "Balance Sheet",
            description: "Flutter",
            imgUrl: projImg3,
        },
        {
            title: "Balance Sheet",
            description: "Flutter",
            imgUrl: projImg3,
        },
       
    ];

    return (
        <section className="project" id="projects">
            <Container>
                <Row>
                    <Col>
                    <TrackVisibility>
                        {({ isVisible}) =>    
                            <div className={isVisible ? "animate__animated animate__fadeIn" : ""}>
                        <h2>Projects</h2>
                        </div>}
                    </TrackVisibility>
                        <Tab.Container id="projects-tabs" defaultActivityKey="first">
                            <Nav variant="pills" className="nav-pills mb-5 justify-content-center align-items-center" id="pills-tab">
                                <Nav.Item>
                                    <Nav.Link eventKey="first">Portfolio Website</Nav.Link>
                                </Nav.Item>
                                <Nav.Item>
                                    <Nav.Link eventKey="second">Facial recognition</Nav.Link>
                                </Nav.Item>
                                <Nav.Item>
                                    <Nav.Link eventKey="third">Balance Sheet App</Nav.Link>
                                </Nav.Item>
                            </Nav>
                            <Tab.Content>
                                <Tab.Pane eventKey="first">
                                    <Row>
                                        {
                                            project1.map((project, index) => {
                                                return (
                                                    <ProjectCard
                                                    key={index}
                                                    {...project}
                                                    />
                                                )
                                            })
                                        }
                                    </Row>
                                    <br></br>
                                    <br></br>
                                    <h2>Personal Porfolio Website</h2>
                                    <h6>Uses: HTML, CSS, React.js and JavaScript</h6>
                                    <br></br>
                                    <p>This is the website for my personal portfolio as a Computer Science major in his Juinor year. Its contensta are basically what languages I know and some of the projects that I have made recently.</p>
                                    <p>Moreover, users can navigate through diffrent sections of the website or can visit my LinkedIn page as well as my GitHub profile just by the click of a button. Feel free to explore and experiment with the website.</p>
                                    
                                </Tab.Pane>
                                <Tab.Pane eventKey="second">
                                <Row>
                                        {
                                            project2.map((project, index) => {
                                                return (
                                                    <ProjectCard
                                                    key={index}
                                                    {...project}
                                                    />
                                                )
                                            })
                                        }
                                    </Row>
                                    <br></br>
                                    <br></br>
                                    <h2>Facial Recognition Application</h2>
                                    <h6>Uses: HTML, CSS, React.js and JavaScript</h6>
                                    <br></br>
                                    <p>This app uses openCV in order to detect a face and recognise it by matching the face with the sample data present in the database.</p>
                                </Tab.Pane>
                                <Tab.Pane eventKey="third">
                                <Row>
                                        {
                                            project3.map((project, index) => {
                                                return (
                                                    <ProjectCard
                                                    key={index}
                                                    {...project}
                                                    />
                                                )
                                            })
                                        }
                                    </Row>
                                    <h1>Balance Sheet App</h1>
                                    <p>This app provides a solution to a realtime problem prevelant among the farmers in my hometown. The system of lending out money and paying the farm workers in daily wages requires the farm owners to keep track of the money they owe and the money they are owed.</p>
                                </Tab.Pane>
                            </Tab.Content>
                        </Tab.Container>
                    </Col>
                </Row>
            </Container>
            <img className="backgound-image-right" src={colorSharp2}></img>
        </section>
    )
}
